import "./MusicUploadForm.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import { faArrowsTurnToDots } from '@fortawesome/free-solid-svg-icons';
import { faCircleDown } from '@fortawesome/free-solid-svg-icons';
import { faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons';


const MusicUploadForm = () => {
    return (
           <div className="upl-form">
                <button className="form-btn">
                    <FontAwesomeIcon icon={faArrowsTurnToDots} />
                    <span className="sip">Track Nu...</span>
                    <FontAwesomeIcon icon={faCircleDown} />
                </button>
                <div className="mag-glass">
                <input className="input-filter" placeholder="Filter..."/>
                <button className="icn-glass"><FontAwesomeIcon icon={faMagnifyingGlass} /></button>
                
                </div>
           </div>
    )
}

export default MusicUploadForm;
